import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="App-header-title">DISCOVERY</div>
        <div className="App-header-item-row">
          <div className="App-header-item">Space</div>
          <div className="App-header-item">Space</div>
          <div className="App-header-item">Space</div>
          <div className="App-header-item">Space</div>
        </div>
      </header>
    </div>
  );
}

export default App;
